// Transactions List service

angular.
    module('transactionsList')
    .factory('transactionsService', ['$http', function ($http) {
        var transactions = []; //Since there are no new transactions initially
        var searchText = '';

        //add a fallback image
        const defaultMerchantLogo = "data:image/gif;base64,";
        return {
            getList: getList,
            setSearchText: setSearchText,
            getSearchText: getSearchText,
            addTransaction: addTransaction,
            getAllTransactions:getAllTransactions,
            transformStringAmountToNumber:transformStringAmountToNumber
        };
        function setSearchText(text) {
            searchText = text;
        }
        function getSearchText() {
            return searchText;
        }
        function getAllTransactions(){
            return transactions;
        }
        function transformStringAmountToNumber(transactions){
            return transactions.map((transaction) => ({
                ...transaction,
                amount: parseFloat(transaction.amount)
            }))
        }
        function addTransaction(merchant, amount, transactionDate, merchantLogo, transactionType = "Form Transfer", categoryCode = "#000000") {
            transactions.unshift({
                amount,
                categoryCode,
                merchant,
                merchantLogo: merchantLogo || defaultMerchantLogo,
                transactionDate,
                transactionType
            })
        }

        // Get records from the mock
        function getList() {
            return new Promise((resolve, reject) => {
                $http.get('transactions/transactions.json').then(function success(response) {
                    transactions = transformStringAmountToNumber(response.data.data);
                    resolve(transactions);
                }, function error(error) {
                    reject(error)
                })
            })
        }
    }])